INSERT INTO `aula` (`id_aula`, `nome_aula`, `desc_aula`, `mod_id_aula`, `curso_id_aula`, `cronograma_semanas`, `treinamento`, `est_id_aula`, `prof_id_aula`) VALUES
(29, 'Pós Operatório na Terapia Intensiva', 'Após o procedimento cirúrgico, os pacientes chegam à UTI ainda sob o efeito da anestesia, com respiração artificial e com necessidade de estabilização.', 11, 19, NULL, NULL, 35, 12),
(30, 'Dor Precordial', 'Um paciente chega pra você e se queixa de dor no peito. O que fazer?\nAprenda nessa aula do professor Ronaldo Gismondi como avaliar essa situação.', 11, 19, NULL, NULL, 35, 13),
(31, 'Sepse para acadêmicos', 'Uma das maiores preocupações na Medicina, SEPSE é um assunto essencial para a prática médica cotidiana.', 11, 19, NULL, NULL, 35, 14),
(32, 'Ventilação mecânica', 'A ventilação mecânica (VM) ou, como seria mais adequado chamarmos, o suporte ventilatório, consiste em um método de suporte para o tratamento de pacientes com insuficiência respiratória aguda ou crônica agudizada.', 11, 19, NULL, NULL, 35, 18),
(33, 'Arritmias', 'As arritmias são alterações no ritmo cardíaco normal muito comum em nossa população, sendo de significativa importância para o cotidiano hospitalar.', 11, 19, NULL, NULL, 35, 17),
(34, 'AVC', 'O AVC (Acidente Vascular Cerebral), popularmente conhecido como derrame, está entre as principais causas de morte no mundo. Dito isso, a Organização Mundial de AVC prevê que uma em cada seis pessoas terá o problema ao longo da vida.', 11, 19, NULL, NULL, 35, 18),
(35, 'Lesão renal aguda', 'É a diminuição rápida da função renal ao longo de dias a semanas, causando acúmulo de produtos nitrogenados no sangue (azotemia) com ou sem redução na quantidade de débito urinário.', 11, 19, NULL, NULL, 35, 20),
(37, 'Insuficiência cardíaca', 'Conhecer os sintomas de insuficiência cardíaca é fundamental para atuar de forma preventiva e evitar episódios de descompensação cardíaca.', 11, 19, NULL, NULL, 35, 21),
(38, 'Tromboembolismo Pulmonar (TEP)', 'Tromboembolismo Pulmonar (TEP) é a obstrução parcial ou total da artéria pulmonar ou de seus ramos. O TEP é causado pelo alojamento de partículas oriundas de outra parte do organismo.', 11, 19, NULL, NULL, 35, 19),
(39, 'Desmame ventilatório e sedação', 'O termo desmame refere-se ao processo de transição da ventilação artificial para a espontânea, nos pacientes que permanecem em ventilação mecânica invasiva por tempo superior a 24 horas', 11, 19, NULL, NULL, 35, 19),
(45, 'TESTE 45', 'TESTE 1', 21, NULL, 1, 'sim', 35, 12),
