(19, 35, 'Curso de Aprimoramento', 'O Curso de Aprimoramento, que possui o Selo MedHub de qualidade, proporciona ao acadêmico de Medicina a preparação mais adequada para a prova do Programa de Estágio do Hospital Badim. O preparatório engloba todas as 10 aulas das matérias que serão cobradas no concurso, de forma objetiva, didática e por professores renomados.', 'aula.png');
