INSERT INTO `estagio` (`id_est`, `hosp_id_est`, `nome_est`, `treinamento`, `desc_est`, `valor_est`, `link_valor_est`, `valor_desc_est`, `val_pix_est`, `chave_pix_est`, `edital_est`, `link_prova_est`, `link_huber_est`, `ativo_est`, `vagas_est`, `nota_med_est`, `exc_est`, `data_inicio_est`, `data_termino_est`) VALUES
(35, 17, 'Programa de Estágio - Hospital Badim', 'sim', 'A infraestrutura do Hospital Badim, detentor até hoje da Acreditação ONA, foi cuidadosamente planejada para oferecer o máximo de conforto e segurança aos pacientes e profissionais, além de permitir que as atividades assistenciais ocorram de forma ágil e eficiente. A unidade adotou o conceito de hotelaria hospitalar de luxo em suas instalações, priorizando o atendimento personalizado em um ambiente altamente humanizado. ', '00,00', 'https://mpago.la/2JUWFVd', '00,00', '285,00', '00020126580014BR.GOV.BCB.PIX01361df94441-e908-42df-83ad-3a968ffc7f725204000053039865406285.005802BR5906Medhub6009SAO PAULO610805409000622505218WfLQqOqocqRsxo10gquk6304F647', 'A MedHub faz saber aos interessados que irá promover o Concurso para Acadêmico de Medicina do Hospital Badim no ano de 2022 para ingresso no primeiro semestre de 2023. O presente Processo Seletivo para Estágio Não-Obrigatório ofertará vagas nas unidades de Terapia Intensiva para os alunos aprovados e classificados. As partes desse processo que envolvem inscrição, realização da prova, armazenamento de documentos, exclusão e reclassificação se darão de forma online. O valor da remuneração será de R$ 545,00. Cronograma: Divulgação do edital e abertura do processo seletivo 26/09/2022; Inscrição no Processo Seletivo 26/09/2022 a 13/11/2022; Realização do Curso Preparatório 14/11/2022 até 11/12/2022; Prova Objetiva Online 11/12/2022; Divulgação do gabarito preliminar 11/12/2022 (Edital sujeito a atualizações pelo Hospital)\r\n', 'https://app.boloforms.com/start/63928ea045486255eef3d150', 'https://forms.gle/EWWYCoEdEkBfpcXFA                                            \r\n                                                ', 'Desativado', '14', '7.5', 'Modelo de exceção: nesse caso, o curso preparatório vem antes da prova e serve para te capacitar para a mesma', '06/02/2023', '');
